ze the display of this screen&#8217;s contents in a number of ways:";}i:406;O:8:"stdClass":7:{s:2:"id";s:5:"12978";s:4:"name";s:32:"d6e863468c3551518fa205b1060b3cf3";s:7:"context";s:7:"default";s:6:"status";N;s:15:"gettext_context";s:0:"";s:3:"tra";N;s:4:"orig";s:123:"You can hide/display columns based on your needs and decide how many posts to list per screen using the Screen Options tab.";}i:407;O:8:"stdClass":7:{s:2:"id";s:5:"12979";s:4:"name";s:32:"893b004b3b255507cc8437e21994eadb";s:7:"context";s:7:"default";s:6:"status";N;s:15:"gettext_context";s:0:"";s:3:"tra";N;s:4:"orig";s:165:"You can filter the list of posts by post status using the text links above the posts list to only show posts with that status. The default view is to show all posts.";}i:408;O:8:"stdClass":7:{s:2:"id";s:5:"12980";s:4:"name";s:32:"69bf2bc0a778d2be3e4a04bc44a4f549";s:7:"context";s:7:"default";s:6:"status";N;s:15:"gettext_context";s:0:"";s:3:"tra";N;s:4:"orig";s:90:"You can view posts in a simple title list or with an excerpt using the Screen Options tab.";}i:409;O:8:"stdClass":7:{s:2:"id";s:5:"12981";s:4:"name";s:32:"a4e5684835acb802ee3194c309c7ed1a";s:7:"context";s:7:"default";s:6:"status";N;s:15:"gettext_context";s:0:"";s:3:"tra";N;s:4:"orig";s:289:"You can refine the list to show only posts in a specific category or from a specific month by using the dropdown menus above the posts list. Click the Filter button after making your selection. You also can refine the list by clicking on the post author, category or tag in the posts list.";}i:410;O:8:"stdClass":7:{s:2:"id";s:5:"12982";s:4:"name";s:32:"0f05ceec0844c366727708a4f37bc8d4";s:7:"context";s:7:"default";s:6:"status";N;s:15:"gettext_context";s:0:"";s:3:"tra";N;s:4:"orig";s:17:"Available Actions";}i:411;O:8:"stdClass":7:{s:2:"id";s:5:"12983";s:4:"name";s:32:"324a8e205fd6e1ed56142378c52931a8";s:7:"context";s:7:"default";s:6:"status";N;s:15:"gettext_context";s:0:"";s:3:"tra";N;s:4:"orig";s:138:"Hovering over a row in the posts list will display action links that allow you to manage your post. You can perform the following actions:";}i:412;O:8:"stdClass":7:{s:2:"id";s:5:"12984";s:4:"name";s:32:"0bdd62cf14b1ac2df851e97eed7faa8c";s:7:"context";s:7:"default";s:6:"status";N;s:15:"gettext_context";s:0:"";s:3:"tra";N;s:4:"orig";s:130:"<strong>Edit</strong> takes you to the editing screen for that post. You can also reach that screen by clicking on the post title.";}i:413;O:8:"stdClass":7:{s:2:"id";s:5:"12985";s:4:"name";s:32:"099f3df0632488f2c47e2658d95e0e76";s:7:"context";s:7:"default";s:6:"status";N;s:15:"gettext_context";s:0:"";s:3:"tra";N;s:4:"orig";s:145:"<strong>Quick Edit</strong> provides inline access to the metadata of your post, allowing you to update post details without leaving this screen.";}i:414;O:8:"stdClass":7:{s:2:"id";s:5:"12986";s:4:"name";s:32:"1ac12183049e2cd887bb8ee6b488d5fb";s:7:"context";s:7:"default";s:6:"status";N;s:15:"gettext_context";s:0:"";s:3:"tra";N;s:4:"orig";s:125:"<strong>Trash</strong> removes your post from this list and places it in the trash, from which you can permanently delete it.";}i:415;O:8:"stdClass":7:{s:2:"id";s:5:"12987";s:4:"name";s:32:"b807523847b38ac8553394a6e915ef62";s:7:"context";s:7:"default";s:6:"status";N;s:15:"gettext_context";s:0:"";s:3:"tra";N;s:4:"orig";s:209:"<strong>Preview</strong> will show you what your draft post will look like if you publish it. View will take you to your live site to view the post. Which link is available depends on your post&#8217;s status.";}i:416;O:8:"stdClass":7:{s:2:"id";s:5:"12988";s:4:"name";s:32:"c83a2faddec053e93996bea49df84dd8";s:7:"context";s:7:"default";s:6:"status";N;s:15:"gettext_context";s:0:"";s:3:"tra";N;s:4:"orig";s:204:"You can also edit or move multiple posts to the trash at once. Select the posts you want to act on using the checkboxes, then select the action you want to take from the Bulk Actions menu and click Apply.";}i:417;O:8:"stdClass":7:{s:2:"id";s:5:"12989";s:4:"name";s:32:"4fd5e879927f1